// content.js
chrome.runtime.onMessage.addListener((message, sender, sendResponse) => {
  if (message.action === 'addmedia') {
      // Perform action here
      sendResponse({ success: true });
      addMedia();
      // Send a response back to the popup script
      
  }
});

function addMedia() {
  // Load the Base64 encoded image into the webpage's DOM
  const img = document.createElement('img');
  img.src = "data:image/png;base64,";
  img.style.position = 'fixed';
  img.style.top = '30px'; // Added "px" for pixels
  img.style.left = '30px'; // Added "px" for pixels
  img.classList.add('overlay-image');
  
  document.body.appendChild(img);
}